import { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";

export default function Dashboard() {
  const [residente, setResidente] = useState({ rut: "", nombre: "Pendiente de BD" });
  const location = useLocation();

  // Obtener rut desde query string
  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const rutQuery = params.get("rut");
    if (rutQuery) setResidente(prev => ({ ...prev, rut: rutQuery }));
  }, [location]);

  return (
    <div className="min-h-screen bg-gray-300 flex flex-col items-center">
      {/* Banner */}
      <header className="w-full h-24 bg-gray-200 border-b border-black flex items-center justify-between px-6">
        <div className="flex items-center gap-4">
          <div
            className="w-18 h-18 bg-contain bg-no-repeat bg-center"
            style={{ backgroundImage: 'url("/image.png")' }}
          />
          <h1 className="text-3xl font-bold text-teal-600">Red ELEAM</h1>
        </div>
        <h2 className="text-2xl font-bold">Portal de Medicamentos ELEAM</h2>
        <div className="w-12 h-12 bg-gray-400 rounded-full flex items-center justify-center">
          🔔
        </div>
      </header>

      {/* Contenido principal */}
      <main className="flex flex-col items-center mt-10 w-full max-w-6xl px-4 md:px-0 gap-10">
        {/* Datos del residente */}
        <div className="w-full bg-white bg-opacity-70 border border-black rounded-2xl p-6 flex flex-col md:flex-row gap-6">
          <div className="w-36 h-36 bg-gray-200 border border-black rounded-md flex-shrink-0"></div>
          <div className="flex flex-col justify-center text-lg font-mono gap-2">
            <p><b>Nombre residente:</b> {residente.nombre}</p>
            <p><b>RUN:</b> {residente.rut}</p>
            <p><b>Próximo control:</b> ..................</p>
            <p><b>Médico tratante:</b> ..................</p>
          </div>
        </div>

        {/* Botones de acción */}
        <div className="flex flex-wrap gap-4 justify-center">
          <button className="flex items-center gap-2 bg-teal-600 hover:bg-teal-700 text-white font-bold py-4 px-6 rounded">
            📄 Ver Ficha Clínica
          </button>
          <button className="flex items-center gap-2 bg-teal-600 hover:bg-teal-700 text-white font-bold py-4 px-6 rounded">
            ℹ️ Información Control Anterior
          </button>
          <button className="flex items-center gap-2 bg-teal-600 hover:bg-teal-700 text-white font-bold py-4 px-6 rounded">
            💊 Información Medicamentos
          </button>
          <button className="flex items-center gap-2 bg-red-600 hover:bg-red-700 text-white font-bold py-4 px-6 rounded">
            🚪 Salir
          </button>
        </div>

        {/* Diagnóstico */}
        <div className="w-full bg-white bg-opacity-70 border border-black rounded-2xl p-6 flex flex-col md:flex-row gap-6">
          <div className="flex-1 font-mono text-lg flex flex-col gap-2">
            <p><b>Diagnóstico:</b> .......................................</p>
            <p><b>Médico que indica:</b> ......................</p>
          </div>
          <div className="flex-1 font-mono text-lg flex flex-col gap-2">
            <p><b>Nombre Medicamento (Compuesto):</b> ....</p>
            <p><b>Dosis:</b> ..... cada ......</p>
            <p><b>Caso SOS:</b> .......................</p>
          </div>
        </div>
      </main>
    </div>
  );
}
